import React from 'react'

const About = () => {
  return (
    <section className="section about-section">
      <h1 className="section-title">About us</h1>
      <p>Este es el primer proyecto de React con Next.js, que hacemos con Los Tanos del Código, con la intención de practicar y tomar impuslo para otros proyectos, que nos ayuden a conseguir nuestros objetivos</p>
    </section>
  );
}

export default About
